package com.winway.wwapp2;/** * 通訊錄項目 *  *  */public class AddressItem {		private String name;	private String address;		public AddressItem(){}	public AddressItem(String name,String address){		this.name  = name;		this.address  = address;			}	public String getName(){		return this.name;	}	public String getAddress(){		return this.address;	}	public void setAddress(String address){		this.address = address;	}	public void setName(String name){		this.name =name;	}}